import  React, { useEffect,useState } from 'react'
import axios from 'axios'
import serverApiHost from "../../global";


const PageAllCards = () =>
{

    const [message, setMessage] = useState()

    const GetInformationAboutCard = async () => {

        const response = await axios.get('http://'+serverApiHost+':5001/api/cardVSM/view',
        {
            headers: {
                'Access-Control-Allow-Origin': '*',
                'Content-Type': 'application/json'
            }
        })

        if(response.status != 200)
        {
          return ;
        }

        let content = response.data as any;

        setMessage(content);
    }


    useEffect(() => {
         GetInformationAboutCard();
    },[])

    return (
        <div>
            <p>PageAllCards</p>
        </div>
    )   
}


export default PageAllCards;
